namespace Armstrong1992\ZplImageToolBox\Tests\Unit\ImageData\Compressor;

use Armstrong1992\ZplImageToolBox\ImageData\Compressor\Exception\CompressorException;
use Armstrong1992\ZplImageToolBox\ImageData\Compressor\ZplCompressor;
use PHPUnit\Framework\Attributes\CoversClass;
use PHPUnit\Framework\Attributes\DataProvider;
use PHPUnit\Framework\TestCase;

#[CoversClass(ZplCompressor::class)]
final class ZplCompressorTest extends TestCase
{
    public function testSupports(): void
    {
        $zplCompressor = $this->getZplCompressor();

        $this->assertTrue($zplCompressor->supports('ajk'));
        $this->assertTrue($zplCompressor->supports('1'));
        $this->assertTrue($zplCompressor->supports('90643'));
        $this->assertTrue($zplCompressor->supports('asdefghIJK'));
        $this->assertFalse($zplCompressor->supports(':Z64:asd'));
        $this->assertFalse($zplCompressor->supports(':Z64asd'));
        $this->assertFalse($zplCompressor->supports('Z64asd'));
        $this->assertFalse($zplCompressor->supports('Z'));
        $this->assertFalse($zplCompressor->supports(''));
    }

    public function testPassedNotSupportedData(): void
    {
        $this->expectException(CompressorException::class);
        $this->expectExceptionMessage('Provided compressed data is not supported by this decompressor.');

        $this->getZplCompressor()->decompress('ąść', 10, 10);
    }

    #[DataProvider('provideDecompressTestData')]
    public function testDecompress(
        int    $imageDataSize,
        int    $imageDataRowSize,
        string $compressedData,
        string $expectedHexResult
    ): void
    {
        $zplCompressor = $this->getZplCompressor();

        $decompressed = $zplCompressor->decompress($compressedData, $imageDataSize, $imageDataRowSize);

        $this->assertEquals(strtoupper($expectedHexResult), strtoupper($decompressed));

    }

    public function testInvalidDecompressedData(): void
    {
        $zplCompressor = $this->getZplCompressor();

        $this->expectException(CompressorException::class);
        $this->expectExceptionMessage('Decompressed data size (70) does not match expected size (10).');

        $zplCompressor->decompress('lL0P2J0', 10, 5);
    }

    private function getZplCompressor(): ZplCompressor
    {
        return new ZplCompressor();
    }

    public static function provideDecompressTestData(): \Generator
    {
        yield [
            35770,
            70,
            '::::lS02L0lS07L0lS0F808I0lS07L0lM02KAFAK0lM017HF7HFDK0lM0NFE8I0lL01NFCJ0lL03FKAFHAJ0lL03DK07L0lL0BE80808F808I0lL07CK07L0lL0B8K078K0lL07L07L0lL0B8K0F8K0lL07L07L0lL038K078K0lL01L05L0lL0A8K0A8K0m0::::::::::::::::::::::::::::::::::::::::::::::::::',
            '',

        ];
        yield [
            37518,
            78,
            '::::::',
            '',
        ];
    }
}
